        function selectSort(arr){
            let len = arr.length;
            let index;
            for(let i = 0; i < len - 1; i ++){
                index = i;
                for(let j = i + 1; j < len; j ++){
                    if(arr[index] > arr[j]){
                        index = j
                    }
                }
                if(index !== i){
                    let tem = arr[index]
                    arr[index] = arr[i];
                    arr[i] = tem
                }
            }
            return arr
        }
